INSERT INTO `help` (`id`, `title`, `yes`, `no`, `content`, `alias`, `createtime`) VALUES
(1, '我从未收到邮件或安全密钥', 8, 10, '首先请您确保，您是否提交了找回密码的请求，如果没有提交，请点击<a href="forgot-password.html">这里提交</a>，其次请您确保您当时注册的邮箱是否可以正常使用，如果邮箱可以正常使用，那么请到邮箱的收件箱或垃圾箱查找小店记账宝给您发送的找回密码的邮件', 'nokey', '0000-00-00 00:00:00'),
(2, '密钥是什么', 5, 7, '当您找回密码时，小店记账宝会向您当时注册时的邮箱发送一个动态的安全密钥，这个安全密钥的格式如下：<p>\n                 <code>91db89bce4649aea6cb225ead06661ae</code></p>', 'whatkey', '0000-00-00 00:00:00');
